// NavMenu.js

import React from 'react';
import { Link } from 'react-router-dom';

const NavMenu = (props) => {
  // set the class based on the passed isOpen prop - default is false
  const toggleClassname = props.isOpen ? "NavMenu NavMenu--open" : "NavMenu";
  /* const toggleClassname = true ? "NavMenu NavMenu--open" : "NavMenu"; */

  return(
    <div className={toggleClassname}>
      <ul className="NavMenu__list">
        <li className="NavMenu__listItem">
          <Link to="/" className="NavMenu__anchor">
            <i className="material-icons-round md-24 md-light">home</i>
            <span className="NavMenu__anchorText">Forside</span>
          </Link>
        </li>
        <li className="NavMenu__listItem">
          <a className="NavMenu__anchor" href="#">
            <i className="material-icons-round md-24 md-light">groups</i>
            <span className="NavMenu__anchorText">Om os</span>
          </a>
        </li>
        <li className="NavMenu__listItem">
          <a className="NavMenu__anchor" href="#">
            <i className="material-icons-round md-24 md-light">add_business</i>
            <span className="NavMenu__anchorText">Partners</span>
          </a>
        </li>
      </ul>
    </div>
  )
}

export default NavMenu;
